		<p>MBO API</p>
		{console.log(props)}

		<ul>{/* {props.schedule.map((class) => (
					<p>{schedule}</p>
			))} */}</ul>
	</Layout>
);

Mindbodyonline.getInitialProps = async function() {
	const url = 'https://api.mindbodyonline.com/public/v6/class/classschedules?limit=100&offset=0';
	const res = await fetch(url, {
		method         : 'POST', // *GET, POST, PUT, DELETE, etc.
		mode           : 'cors', // no-cors, *cors, same-origin
		cache          : 'no-cache', // *default, no-cache, reload, force-cache, only-if-cached
		credentials    : 'same-origin', // include, *same-origin, omit
		headers        : {
			'Content-Type' : 'application/json'
			// 'Content-Type': 'application/x-www-form-urlencoded',
		},
		redirect       : 'follow', // manual, *follow, error
		referrerPolicy : 'no-referrer', // no-referrer, *client
		body           : JSON.stringify(data) // body data type must match "Content-Type" header
	});
	return await response.json(); // parses JSON response into native JavaScript objects);
	const data = await res.json();
	console.log(`MBO data fetched successfully.`);

	return {
		schedule : data
	};
};

export default Mindbodyonline;
